import {View, Image} from 'react-native';

const ActionBarImage = () => {
    return (
        <View style={{flexDirection: 'row'}}>
            <Image
                source={require('../assets/icons/bank.png')}
                style={{
                    width: 40,
                    height: 40,
                    // borderRadius: 40 / 2,
                    marginLeft: 15,
                    resizeMode : "contain"

                }}
            />
        </View>
    );
};

export default ActionBarImage;
